import React, { Component } from "react";
import "./App.css";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import {
  faLinkedin,
  faTelegram,
  faGithub,
  faStackOverflow
} from "@fortawesome/free-brands-svg-icons";
import { faDownload, faEnvelope } from "@fortawesome/free-solid-svg-icons";
import Card from "./components/Card";

class App extends Component {
  render() {
    return (
      <div style={{
        backgroundColor: "azure",
        height: "100vh",
        paddingBottom: "20vh"
      }}
        className="d-flex align-items-center"
      >
        <div
          className="border mx-auto my-auto"
          style={{
            backgroundColor: "white",
            width: "fit-content",
            padding: "20px",
            borderRadius: "1.5rem",
            height: "fit-content"
          }}>
          <h3 className="mb-4 mx-auto" style={{ width: "fit-content" }}>Alireza Azizi</h3>
          <div
            className="justify-content-center mb-4"
          >
            <div className="list-inline">
              Linkedin
              <Card>
                <a
                  data-toggle="tooltip"
                  data-placement="bottom"
                  title="Linkedin"
                  href="https://www.linkedin.com/in/alireza-azizi-8a53521b4/"
                >
                  <FontAwesomeIcon
                    icon={faLinkedin}
                    size="3x"
                    color="#0077b5"
                    style={{
                      padding: "10px",
                    }}
                  />
                </a>
              </Card>
            </div>

            <Card>
              <a
                data-toggle="tooltip"
                data-placement="bottom"
                title="Github"
                href="https://github.com/alrzazz/"
              >
                <FontAwesomeIcon
                  icon={faGithub}
                  size="3x"
                  color="black"
                  style={{
                    padding: "10px",
                  }}
                />
              </a>
            </Card>
            <Card>
              <a
                data-toggle="tooltip"
                data-placement="bottom"
                title="Github"
                href="https://stackoverflow.com/users/13069919/alireza-azizi"
              >
                <FontAwesomeIcon
                  icon={faStackOverflow}
                  size="3x"
                  color="orange"
                  style={{
                    padding: "10px",
                  }}
                />
              </a>
            </Card>
            <Card>
              <a
                data-toggle="tooltip"
                data-placement="bottom"
                title="Telegram"
                href="https://t.me/alrzazz"
              >
                <FontAwesomeIcon
                  icon={faTelegram}
                  size="3x"
                  color="#0088cc"
                  style={{
                    padding: "10px",
                  }}
                />
              </a>
            </Card>
            <Card>
              <a
                data-toggle="tooltip"
                data-placement="bottom"
                title="Resume"
                href="https://raw.githubusercontent.com/alrzazz/CV/6d477f8b7e52beaefc34ef13ae97293d4f8084b7/cv.pdf"
              >
                <FontAwesomeIcon
                  icon={faDownload}
                  size="3x"
                  color="#44dd33"
                  style={{
                    padding: "10px",
                  }}
                />
              </a>
            </Card>
            <Card>
              <a
                data-toggle="tooltip"
                data-placement="bottom"
                title="Gmail"
                href="mailto:alrzazz@yahoo.com"
              >
                <FontAwesomeIcon
                  icon={faEnvelope}
                  size="3x"
                  color="red"
                  style={{
                    padding: "10px",
                  }}
                />
              </a>
            </Card>
          </div>
        </div>
      </div>
    );
  }
}

export default App;
